									Due: <br><?= $dataPersewaan[0]['TANGGAL_BAYAR']?>
								</td>
							</tr>
						</table>
					</td>
				</tr>

				<tr class="information">
					<td colspan="2">
						<table>
							<tr>
								<td>
									Jl. Wonorejo Rungkut 1/5<br />
									Surabaya, 60296
								</td>

								<td>
									CV. Yuda Pratama<br />
									031-8714355<br />
									ypyudapratama@gmail.com
								</td>
							</tr>
						</table>
					</td>
				</tr>

				<tr class="heading">
					<td>Rincian Penggunaan</td>
